import './index.css'

const EventsList = () => {
  return (
    <div className="events-container">
      <h1>Events List</h1>
      <div>
        <h1>No Events</h1>
      </div>

      <button className="btn">Click Here to Add Events</button>
    </div>
  )
}

export default EventsList
